import React from "react";
import Card from './card'
import Title from '../title';
const cards = [
  { title: 'Tráfego pago', content: 'Conteúdo do Card 1' },
  { title: 'Topo das pesquisas', content: 'Conteúdo do Card 2' },
  { title: 'Gestão de mídias sociais', content: 'Conteúdo do Card 3' },

];
const cards2 = [
  { title: 'Whatsapp business', content: 'Conteúdo do Card 3' },
  { title: 'Website moderno', content: 'Conteúdo do Card 3' },
  { title: 'Apps personalizados', content: 'Conteúdo do Card 3' },
];
export default function Cards() {
  return (
    <section className="w-[100%] h-[100%] flex z-1 items-center pt-[46px] px-[100px] flex-col bg-fuchsia-950">
      <Title title={'360° Digital'} description={'Com nossas tecnologias e profissionais especializados fazemos sua empresa decolar nas vendas digitais'}/>
      <div className="w-[100%] flex max-w-7xl items-center flex-row">
        <div className="gap-[32px] w-[100%] flex items-center mb-[32px] flex-col px-[15px]">

        {cards2.map((card, index) => (
          <Card key={index} title={card.title} content={card.content} />
          ))}
        </div>
        <div className="gap-[32px] w-[100%] flex items-center mb-[32px] flex-col px-[15px]">

          {cards.map((card, index) => (
          <Card key={index} title={card.title} content={card.content} />
         ))}
        </div>
      </div>
    </section>
  );
}
